import React, { Component } from 'react';

import Todo from './Todo';

function TodoList({todoItems}){
    return (
        <div id="todoContainer">
            <ul id="todoItems">
             {todoItems.map(todo =>(
               <Todo text={todo.text} id={todo.id}/>
             ))}
            </ul>
       </div>
    );
  }

export default TodoList;
